import React from 'react';
import {
  StyleSheet,
  View,
  Text
} from 'react-native';

import { NavigationContainer } from '@react-navigation/native';
import {createStackNavigator} from '@react-navigation/stack'

const Stack = createStackNavigator();

function ScreenA(){
  return(
    <View style={styles.body}> 
      <Text>
        Screen A
      </Text>
    </View>
  )
}

function App() {
  return (
   <NavigationContainer>
     <Stack.Navigator>
       <Stack.Screen
       name="Screen_A"
       component={ScreenA}/>
     </Stack.Navigator>
   </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  body:{
    flex:1,
    justifyContent:"center",
    alignItems:"center"
  }
})

export default App;
